package main

import (
	"bufio"
	"bytes"
	"encoding/base64"
	"fmt"
	"io"
	"os"
	"os/exec"
	"strconv"
	"strings"
)

// Base64-encoded contents of testcasesB.txt.
const testcasesB64 = ""

type testCase struct {
	n     int
	w, h  int64
	a, b  []int64
}

func buildIfGo(path string) (string, func(), error) {
	if strings.HasSuffix(path, ".go") {
		tmp, err := os.CreateTemp("", "solbin*")
		if err != nil {
			return "", nil, err
		}
		tmp.Close()
		if out, err := exec.Command("go", "build", "-o", tmp.Name(), path).CombinedOutput(); err != nil {
			os.Remove(tmp.Name())
			return "", nil, fmt.Errorf("build failed: %v\n%s", err, out)
		}
		return tmp.Name(), func() { os.Remove(tmp.Name()) }, nil
	}
	return path, func() {}, nil
}

func runCandidate(bin, input string) (string, error) {
	cmd := exec.Command(bin)
	cmd.Stdin = strings.NewReader(input)
	var out bytes.Buffer
	var errb bytes.Buffer
	cmd.Stdout = &out
	cmd.Stderr = &errb
	if err := cmd.Run(); err != nil {
		return "", fmt.Errorf("runtime error: %v\n%s", err, errb.String())
	}
	return strings.TrimSpace(out.String()), nil
}

func parseTestcases() ([]testCase, error) {
	raw, err := base64.StdEncoding.DecodeString(testcasesB64)
	if err != nil {
		return nil, err
	}
	reader := bufio.NewReader(bytes.NewReader(raw))
	cases := make([]testCase, 0)
	for {
		var tc testCase
		_, err := fmt.Fscan(reader, &tc.n, &tc.w, &tc.h)
		if err == io.EOF {
			break
		}
		if err != nil {
			return nil, fmt.Errorf("case %d header: %v", len(cases)+1, err)
		}
		tc.a = make([]int64, tc.n)
		for i := 0; i < tc.n; i++ {
			if _, err := fmt.Fscan(reader, &tc.a[i]); err != nil {
				return nil, fmt.Errorf("case %d a[%d]: %v", len(cases)+1, i, err)
			}
		}
		tc.b = make([]int64, tc.n)
		for i := 0; i < tc.n; i++ {
			if _, err := fmt.Fscan(reader, &tc.b[i]); err != nil {
				return nil, fmt.Errorf("case %d b[%d]: %v", len(cases)+1, i, err)
			}
		}
		cases = append(cases, tc)
	}
	if len(cases) == 0 {
		return nil, fmt.Errorf("no testcases found")
	}
	return cases, nil
}

func min(a, b int64) int64 {
	if a < b {
		return a
	}
	return b
}

// Embedded solver logic from 1786B.go.
func solve(tc testCase) string {
	lower := int64(-1 << 60)
	upper := int64(1 << 60)
	for i := 0; i < tc.n; i++ {
		l := (tc.b[i] + tc.h) - (tc.a[i] + tc.w)
		r := (tc.b[i] - tc.h) - (tc.a[i] - tc.w)
		if l > lower {
			lower = l
		}
		if r < upper {
			upper = r
		}
	}
	if lower <= upper {
		return "YES"
	}
	return "NO"
}

func main() {
	if len(os.Args) != 2 {
		fmt.Println("usage: go run verifierB.go /path/to/binary")
		os.Exit(1)
	}

	cases, err := parseTestcases()
	if err != nil {
		fmt.Fprintln(os.Stderr, err)
		os.Exit(1)
	}

	bin, cleanup, err := buildIfGo(os.Args[1])
	if err != nil {
		fmt.Fprintln(os.Stderr, err)
		os.Exit(1)
	}
	defer cleanup()

	for idx, tc := range cases {
		var input strings.Builder
		fmt.Fprintf(&input, "1\n%d %d %d\n", tc.n, tc.w, tc.h)
		for i, v := range tc.a {
			if i > 0 {
				input.WriteByte(' ')
			}
			input.WriteString(strconv.FormatInt(v, 10))
		}
		input.WriteByte('\n')
		for i, v := range tc.b {
			if i > 0 {
				input.WriteByte(' ')
			}
			input.WriteString(strconv.FormatInt(v, 10))
		}
		input.WriteByte('\n')

		want := solve(tc)
		got, err := runCandidate(bin, input.String())
		if err != nil {
			fmt.Fprintf(os.Stderr, "case %d failed: %v\n", idx+1, err)
			os.Exit(1)
		}
		if strings.TrimSpace(got) != want {
			fmt.Fprintf(os.Stderr, "case %d failed: expected %s got %s\n", idx+1, want, got)
			os.Exit(1)
		}
	}
	fmt.Printf("All %d tests passed\n", len(cases))
}
